        width:'30px',
        height:'30px',
        borderRadius:'15px',
        display:'inline-block',
        border: '1px solid black',
        backgroundColor:work ? 'green':'red',
        marginLeft:'5px'
    }


    return ( <span>

            <span  onClick={()=>{setWork(false)}} style={StyleButtonOFF}>
               OFF
            </span>
